eval("__webpack_require__.r(__webpack_exports__);\nconst work = [{\n  id: 'devGIM',\n  title: 'GIM LCC.',\n  oneLiner: 'GIM LLC is an escape room inspired website where players work together to find clues to free the ghost!',\n  note: null,\n  tech: 'JavaScript | React | Socket.io | Context Api | Node | Express',\n  github: 'https://github.com/GIM-LLC',\n  liveSite: 'https://www.escapegim.com/',\n  npmLink: null,\n  blurb1: 'Created by a remote team of five over an eight day sprint. Inspired by escape rooms and ghost stories, GIM (or the Ghost In the Machine) appears to be an innocuous corporate website, but as users explore they find clues about what is actually happening.Built using Socket.io, the initial idea was that the site would host multiple visitors at the same time, so that users could interact and work together to free the ghost before time ran out, and the ghost gets trapped forever. Users can chat with one another, see what other users are doing, and work together! The ghost can be freed on your own, but it is much more difficult.',\n  blurb2: 'Our first hurdle with this project was getting multiple cursors to render on the screen at once and update with each and every mouse move for all users. Once we got that functionality figured out over the socket connetions, all other interactions were fun to figure out!',\n  blurb3: 'This project was really an adventure in CSS animations. Images degrade over time, clues glow, sound effects and shake animations let you know you are making progress, elements flip, move, and dissapear. Explore for yourself to see if you can find all the surprises and free the ghost!',\n  video: '/GIM.mp4',\n  image1: '/GIM.png',\n  image2: '/GIM2.png',\n  image3: '/GIM3.png',\n  image4: '/GIM4.png'\n}, {\n  id: 'devPP',\n  title: 'Pixel Pusher',\n  oneLiner: 'Published NPM package to create unique art right in the terminal window! Users can also save, upload and view artwork in the gallery.',\n  note: null,\n  tech: 'JavaScript | Node | Express | GitHub OAuth | Axios | Inquirer | Blessed',\n  github: 'https://github.com/st-ART-up',\n  liveSite: null,\n  npmLink: 'https://www.npmjs.com/package/@st-art-up/pixel-pusher',\n  blurb1: 'PixelPusher by stARTup creates a canvas and gallery experience right in the users terminal window by simply running the command. In the canvas view users can change the canvas color, paint color, brush sizes, erase, and even add text (a poem, maybe?) to their creations. Using GitHub oAuth, users can save and upload their completed art to be viewed in the gallery. When in gallery view users can manage their own artworks or view artworks created by all other PixelPushers!',\n  blurb2: 'Created by a fully remote team of eight developers, this app was a completely new undertaking for everyone on the team. The biggest challenge was navigating how to integrate two very different libraries within node to run in the terminal window.',\n  blurb3: 'This project was so fun to be a part of, being able to bring art and tech together in the terminal window was an adventure. We look forward to seeing your artworks in the gallery collection!',\n  video: '/PPvid.mp4',\n  image1: '/PP1.png',\n  image2: '/PP2.png',\n  image3: '/PP3.png',\n  image4: null\n}, {\n  id: 'devGG',\n  title: 'GainfulGarden',\n  oneLiner: 'Gardening site for users to search for new plants, and track their garden info. Live site under construction, as our source API was discontinued.',\n  note: null,\n  tech: 'JavaScript | React | Node | Express | Superagent | Toastify',\n  github: 'https://github.com/GainfulGarden',\n  liveSite: 'https://gainfulgarden.netlify.app/',\n  npmLink: null,\n  blurb1: 'big blurb #1 lots more info along with MY contributions blah blah blah lorem ipsum placeholder text for description from resume same stuff  different place description description blah blah blah lorem ipsum placeholder text for description from resume same stuff  different place description description blah blah blah',\n  blurb2: 'big blurb #2 comes after first two images, give fun detail about a challenge, an accomplishment, the backend. lorem ipsum placeholder text for description from resume same stuff  different place description description blah blah blah lorem ipsum placeholder text for description from resume',\n  blurb3: 'big blurb #3 final text block - reflection, sucesses, closing. lorem ipsum placeholder text for description from resume same stuff  different place description description blah blah blah lorem ipsum placeholder text for description from resume',\n  video: null,\n  image1: '/GIM.png',\n  image2: '/GIM.png',\n  image3: '/GIM.png',\n  image4: '/GIM.png'\n}, {\n  id: 'devVM',\n  title: 'Vampire Match',\n  oneLiner: 'Memory card match game based on the movie and television series ',\n  note: 'What We Do In The Shadows.',\n  tech: 'JavaScript | HTML | CSS | QUnit',\n  github: 'https://github.com/UniKittyCorns/MemoryCardGame',\n  liveSite: 'https://vampirematch.netlify.app/',\n  npmLink: null,\n  blurb1: 'A memory matching card game created with vanilla javascript, HTML, and CSS. This vampire themed game is a homage to the movie and series What We Do In The Shadows. This app was completed in a five day sprint by a remote team  of four working collaboratively.',\n  blurb2: 'Users are asked to input their name and select one of the three difficulty levels. This info is saved using the browser\\'s local storage for display and for determining the number of cards in the game. A fun challenge was utilizing CSS transform and rotate animations for the card flips.',\n  blurb3: 'User\\'s scores are also added to the local storage info in order to feed the scoreboard page. Because we were so proud of these awesome illustrations, we had to build in a \\\"give up\\\" functionality so that even if you can\\'t beat the hardest level, you can still see all of the cards face up! Illustration credit to Soraya Benson, you can find her on the GitHub link above.',\n  video: '/VampVid.mp4',\n  image1: '/Vamp1.png',\n  image2: '/Vamp2.png',\n  image3: '/Vamp3.png',\n  image4: '/Vamp4.png'\n}];\n/* harmony default export */ __webpack_exports__[\"default\"] = (work);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/data.js\n");

